// 2. 自动格式化逻辑（无需修改）
export const DEFAULT_DATA = RAW_TEXT.split(/，|\n/) // 按逗号或换行符分割
  .map(s => s.trim()) // 去除空格
  .filter(s => s.length > 0) // 过滤空行
  .map((name) => ({
    "事项名称": name,
    "事项编码": Math.random().toString(36).substr(2, 9).toUpperCase(),
    // 简单推断服务对象
    "服务对象": (name.includes("企业") || name.includes("法人") || name.includes("公司") || name.includes("经营")) ? "法人" : "自然人",
    // 智能提取城市
    "所属市州单位": getCityFromName(name),
    "发布渠道": "通用",
    "是否高频事项": Math.random() > 0.8 ? "是" : "否"
  }));

// 辅助函数：从名称中提取城市
function getCityFromName(name) {
  const cities = ["长沙", "株洲", "湘潭", "衡阳", "邵阳", "岳阳", "常德", "张家界", "益阳", "郴州", "永州", "怀化", "娄底", "湘西", "韶山", "宁乡", "浏阳", "澧县", "桃源", "安化", "平江", "汨罗", "湘阴", "临湘", "新化", "涟源", "冷水江", "双峰", "祁阳", "东安", "蓝山", "新田", "江华", "江永", "道县", "宁远", "慈利", "桑植", "石门", "汉寿", "安乡", "津市", "临澧", "桃江", "南县", "沅江", "赫山", "资阳", "桂阳", "宜章", "永兴", "嘉禾", "临武", "汝城", "桂东", "安仁", "北湖", "苏仙", "中方", "沅陵", "辰溪", "溆浦", "会同", "麻阳", "新晃", "芷江", "靖州", "通道", "洪江", "保靖", "永顺", "龙山", "花垣", "凤凰", "泸溪", "古丈"];
  for (let city of cities) {
    if (name.includes(city)) return city;
  }
  return "全省通用";
}
